import { Fragment, useEffect } from "react";

const ProductList = (props) => {
    
    const product = { id: 5, name: 'M1 MacBook', description: 'Best MacBook on the Market', price: 3699.00 }
    
    useEffect( () => {
        console.log(product);
    })

    const tableStyle = {
        color: 'red',
    };

    return (
        <div>
            <h1>{product.name} - ID:{product.id}</h1>
            <h4 style={tableStyle}>${product.price}</h4>
            <p>{product.description}</p>
        </div>
    );
};

export default ProductList;
